import Axios from "axios";
import React, { useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import header from "./header";

function Home() {
  const [ok, setOK] = useState("");

  function setAuth() {
    Axios({
      method: "GET",
      withCredentials: true,
      url: "http://localhost:3001/",
    })
      .then((res) => {
        setOK(
          <div>
            <h1>Welcome!</h1>
          </div>
        );
      })
      .catch((err) => {
        setOK(
          <div>
            <h1>Pleaca ba!</h1>
          </div>
        );
      });
  }
  useEffect(() => {
    setAuth();
  }, []);
  return (
    <div>
      {ok}
      <header></header>
    </div>
  );
}

export default Home;
